import "@egjs/react-flicking/dist/flicking.css";
import { Box } from "@mui/material";
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper-bundle.min.css';
import 'swiper/swiper.min.css';
import SwiperCore, {
  Autoplay,
  Grid,
  FreeMode,
  Loop
} from 'swiper';

const Slider = () => {

    const images = [
        {
            name: "Almendra",
            src: `${process.env.PUBLIC_URL}/img/toppings/almendra.jpg`
        },
        {
            name: "Amaranto",
            src: `${process.env.PUBLIC_URL}/img/toppings/amaranto.jpg`
        },
        {
            name: "Blueberries",
            src: `${process.env.PUBLIC_URL}/img/toppings/blueberries.jpg`
        },
        {
            name: "Boba",
            src: `${process.env.PUBLIC_URL}/img/toppings/boba.avif`
        },
        {
            name: "Cajeta",
            src: `${process.env.PUBLIC_URL}/img/toppings/cajeta.jpeg`
        },
        {
            name: "Captain Crunch",
            src: `${process.env.PUBLIC_URL}/img/toppings/captain.jpg`
        },
        {
            name: "Cherry",
            src: `${process.env.PUBLIC_URL}/img/toppings/cherry.jpeg`
        }
    ]

    return (
        <Box
            width="100%"
        >
            <Flicking>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/almendra.jpg`} alt="Almendra"/>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/amaranto.jpg`} alt="Almendra"/>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/cajeta.jpeg`} alt="Almendra"/>
                <img src={`${process.env.PUBLIC_URL}/img/toppings/blueberries.jpg`} alt="Almendra"/>
            </Flicking>
        </Box>

    )
}

export default Slider;
